// SongButtons.js
import React from 'react';
import SongButton from './songbutton.js';

const SongButtons = () => {
  const songs = [
    { id: 1, name: 'Song 1' },
    { id: 2, name: 'Song 2' },
    { id: 3, name: 'Song 3' },
    { id: 4, name: 'Song 4' },
    { id: 5, name: 'Song 5' },
    { id: 6, name: 'Song 6' },
    { id: 7, name: 'Song 7' },
    { id: 8, name: 'Song 8' },
    { id: 9, name: 'Song 9' },
    { id: 10, name: 'Song 10' },
  ];

  return (
    <div>
      {songs.map((song) => (
        <SongButton key={song.id} link = "/piano" songName={song.name}/>
      ))}
    </div>
  );
};

export default SongButtons;
